/// \param 发送Image部分时，设备的回复频率。默认4（即SDK发送20包数据，设备进行一次回复），数值越大理论上速度越快，但超过设备的处理能力反而会因为重发而降低整体的发送速度，因此该值需要依据具体的设备性能而定。 
